import React, { Component } from 'react'
import './App.css';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select, { SelectChangeEvent } from '@mui/material/Select';
import { AdapterMoment } from '@mui/x-date-pickers/AdapterMoment';
import { LocalizationProvider } from '@mui/x-date-pickers/LocalizationProvider';
import Backdrop from '@mui/material/Backdrop';
import CircularProgress from '@mui/material/CircularProgress';
import { DesktopDatePicker } from '@mui/x-date-pickers/DesktopDatePicker';
import uniq from "lodash/uniq";
import _ from 'lodash';

const axios = require('axios');


export default class App extends Component {

  constructor(props) {
    super(props)

    this.state = {
      gender: '',
      pincode: '',
      village: '',
      district: '',
      state: '',
      dob: '',
      loadOpen: false,
      pincodesArray: []
    }
  }

  componentDidMount = () => {

    var self = this;

    var body = 'https://parseapi.back4app.com/classes/Indiapincode_Dataset_India_Pin_Code?limit=100&order=placeName&keys=placeName,postalCode&where={"countryCode":"IN"}'

    var header = {
      headers: {
        'x-parse-application-id': '3dkLEsB9Qz7AYajNJ8g9oWLwYp1Ohbh7D4tYjM5w',
        'x-parse-rest-api-key': 'OKRKl1wLkAMZCvzNcHLRIhCI61AHcS2M1svmWO5r',
      }
    };

    axios.get(body, header)
      .then((response) => {

        // Getting Unique Values
        const distintValues = _.uniqBy(response.data.results, 'postalCode');
        console.log(distintValues);

        // Saving State
        self.setState({ pincodesArray: distintValues })

      })
      .catch((e) => {
        console.log(e)
      })
  }

  handleChange = (event) => {

    this.setState({ gender: event.target.value })
    console.log(event.target.value)

  }

  handleChangePincode = (event) => {

    var self = this;

    this.setState({ pincode: event.target.value, loadOpen: true })

    console.log(event.target.value)


    axios.get('https://api.postalpincode.in/pincode/' + event.target.value,)
      .then(function (response) {
        if (response) {
          console.log(response.data[0]);
          console.log(response.data[0].PostOffice[1]);
          self.setState({ village: response.data[0].PostOffice[0].Block, district: response.data[0].PostOffice[0].District, state: response.data[0].PostOffice[0].State, loadOpen: false })
        }
        else {
          console.log('error');
        }
      })
      .catch((error) => {
        console.log(error);
      });

  }

  render() {
    return (
      <div className="row m-4">
        <div className="col-md-4 mx-auto">
          <Card variant="outlined">
            <CardContent>
              <h2 className='text-center'>Sign Up Form</h2>

              <div className='row'>
                <div className='col-md-6 mt-3'>
                  <TextField id="outlined-basic" fullWidth label="First Name" required variant="outlined" />
                </div>

                <div className='col-md-6 mt-3'>
                  <TextField id="outlined-basic" fullWidth label="Last Name" required variant="outlined" />
                </div>

                <div className='col-md-6 mt-3'>
                  <TextField id="outlined-basic" fullWidth label="Email" required variant="outlined" />
                </div>

                <div className='col-md-6 mt-3'>
                  <TextField id="outlined-basic" inputProps={{ maxLength: 10 }} fullWidth label="Phone" required variant="outlined" error={false} helperText="" />
                </div>

                <div className='col-md-6 mt-3'>
                  <FormControl fullWidth>
                    <InputLabel id="demo-simple-select-label">Gender</InputLabel>
                    <Select
                      labelId="demo-simple-select-label"
                      id="demo-simple-select"
                      value={this.state.gender}
                      label="Gender"
                      required
                      onChange={this.handleChange}
                    >
                      <MenuItem value='male'>Male</MenuItem>
                      <MenuItem value='female'>Female</MenuItem>
                    </Select>
                  </FormControl>
                </div>

                <div className='col-md-6 mt-3'>
                  <LocalizationProvider dateAdapter={AdapterMoment}>
                    <DesktopDatePicker
                      label="Date desktop"
                      inputFormat="DD/MM/YYYY"
                      value={this.state.dob}
                      error={false}
                      onChange={(newValue) => {
                        this.setState({ dob: newValue })
                      }}
                      renderInput={(params) => <TextField fullWidth {...params} />}
                    />
                  </LocalizationProvider>
                </div>

                <div className='col-md-12 mt-3'>
                  <TextField id="outlined-basic" multiline maxRows={4} fullWidth label="Address 1" required variant="outlined" />
                </div>

                <div className='col-md-12 mt-3'>
                  <TextField id="outlined-basic" multiline maxRows={4} fullWidth label="Address 2" required variant="outlined" />
                </div>

                <div className='col-md-6 mt-3'>
                  <FormControl fullWidth>
                    <InputLabel id="demo-simple-select-label">Pincode</InputLabel>
                    <Select
                      labelId="demo-simple-select-label"
                      id="demo-simple-select"
                      value={this.state.pincode}
                      label="Pincode"
                      required
                      onChange={this.handleChangePincode}
                    >

                      {uniq(this.state.pincodesArray).map((pincode) => (
                        <MenuItem value={pincode.postalCode}>{pincode.postalCode}</MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                </div>

                <div className='col-md-6 mt-3'>
                  <TextField disabled id="outlined-basic" value={this.state.village} fullWidth label="City/Village" required variant="outlined" />
                </div>

                <div className='col-md-6 mt-3'>
                  <TextField disabled id="outlined-basic" value={this.state.district} fullWidth label="District" required variant="outlined" />
                </div>

                <div className='col-md-6 mt-3'>
                  <TextField disabled id="outlined-basic" value={this.state.state} fullWidth label="State" required variant="outlined" />
                </div>

              </div>
            </CardContent>
            <CardActions>
              <Button fullWidth variant='contained' style={{ paddingTop: 8, paddingBottom: 8 }} disableElevation>Submit</Button>
            </CardActions>
          </Card>

          {/* Loading Backdrop Start */}
          <Backdrop
            open={this.state.loadOpen}
          >
            <CircularProgress color="inherit" />
          </Backdrop>
          {/* Loading Backdrop End */}
        </div>
      </div>
    )
  }
}
